    this.setState({
      type: e.target.value
    })
  }
  handleSubmit = () => {

  }
  render() {
    return (
      <form action="http://www.atguigu.com" onSubmit={this.handleSubmit}>
        name:<input onChange={(e) => this.setState(e, "userName")} type="text" name="username"/><br />
        pwd:<input onChange={(e) => this.setState(e, "password")} type="text" name="password"/><br />
        <button>submit</button>
      </form>
    );
